import { Component } from "react";
import GridList from '@material-ui/core/GridList';
import Item from "../../components/cart-item/Item";

const tileData = [
    {
        img: 'data:image/png;base64,',
        title: 'Image',
        author: 'author',
    }
];

class Home extends Component {

    render() {

        return (
            <div>
                <GridList>
                    <ul>
                        {
                            this.tileData.map(data => {
                                <Item></Item>
                            })
                        }
                    </ul>
                </GridList>
            </div>
        );
    }
}

export default Home;
